ar it and gave us problems. There buddy there wasnt wearing one and yelled at me when I asked why he isnt wearing one and if I had a problem with it which I said I did,  since everyone else there had to wear one. But as usual the tyrants backed up their buddy who was there to get a CCW and didnt make him wear one when all the rest of us did, hence why I took mine off at the end. Typical Costa Mesa corruption, Thanks for the upload Phil! You\u2019re the best!", "Marathon Watching 4/19/23 Seriously?! Really NNC?! \ud83d\ude2e\ud83d\ude2e\u2764\u2764", "Wow I was pulled over by 10-Newport beach pigs and 2-Costa Mesa jerk offs no joke  for no front License plate three weeks ago and none was wearing a mask. But when I reached into my glove compartment for my registration I had a gun to my head. Pigs", "This was filmed with a potato", "\ud83d\udc4d\ud83d\ude0e", "Polly Audis just arrested a Sheriff for doing this.", "\ud83d\ude06\ud83d\ude01\ud83d\ude05 \ud83d\udcaf\ud83d\udcaf\ud83d\udc4d", "\u270c\ufe0f\ud83d\ude0e\ud83d\udcf7\ud83d\udcaf", "\"He refused the order to mask up so I yelled don''t reach for my gun!\" \n\nI''m sure it''s probably happened.", "\ud83c\udfa3\ud83c\udfa3\ud83c\udfa3\ud83c\udfa3\u2764\u2764 truckers the backbone of America", "\ud83d\udc99\ud83e\udd69", "Very useful, thank you.", "Go to Panama and visit us too.", "couldnt live without the white sneaker tip. wow", "It''s expensive probably bc you are living like a tourist.", "Hi! I''m from CR and I understand San Jos\u00e9 is not the prettiest city in the world. It def has a lot of challenges to put it lightly. But there''s neighborhoods like Rohrmoser, Escalante and you didn''t even go to Escaz\u00fa. There''s so many cute coffee shops in the capital that you missed out on.", "If it too expensive why go there?", "Which month did you travel to Costa Rica?", "Not to hate, but I\u2019m from costa rica and I get very sad when someone says not to spend time on San Jose and instead going to place that many cr people can\u2019t afford or just get discriminated there.", "Guys, i went to costa rica last year, and i\u2019m going again tomorrow. If u like tea, just be warned, they do NOT have tea. Starbucks mayyyy have some, but most places DON\u2019T. This year, my family is taking tea bags for our week in cr. Just be warned if u like tea! \u2764", "43k a month! Lmfao! We are all screwed! You mean 4,300 a month. Still crazy!", "I lived in one but you neglected to say that normally you share the room with a roommate", "$43,000 a month. I can live at home with 24/7 nurses for less. What a travesty.", "Where did you learn your math skills $43.000/month doesn''t equal over $50.000/year!!", "At $43,000 a month Thats well over $51,000 a year\ud83d\ude02", "That sounds like she meant 4,300.00 a month, not 43,000. And yes, on the low end you can expect to pay 50-60k a year. Many places are now 9-10k a month. So, 100-120k a year. And that\u2019s before the extras.", "Well I visited two upon being told it was strongly recommended my grandma go to one rather than come home. Both had dementia patients in wheel chairs just stuck in the halls and corners. It was sad", "$43k a month is WAY MORE than $51k/year. Check your math.", "My husband was looking forward to moving to assisted living without me. By all means.", "$43,000 per month, $53,000 per year?", "Which food/drink do you want to try?", "Costa Mesa is a beautiful place to visit and live. I spent my child-hood near this magical coastal city!", "Nice list better than most"]', 0.5, '{"sources": {"zori_csv": false, "overpass_grocery": true, "overpass_night_activity": true, "overpass_noise": true, "irvine_crime": false, "youtube_video": true}}');
INSERT INTO community_metrics (community_id, updated_at, median_rent, rent_2b2b, rent_1b1b, avg_sqft, grocery_density_per_km2, crime_rate_per_100k, rent_trend_12m_pct, night_activity_index, noise_avg_db, noise_p90_db, youtube_video_ids, youtube_comments, overall_confidence, details_json) VALUES ('irvine-spectrum', '2026-02-24 05:30:02.220360', 3400.2223362668137, NULL, NULL, NULL, 0.884, NULL, 2.48, 0.0, 75.0, 82.0, '["VlihgtoWi8E", "SV-_KOL3Vf4", "vtkr-PT4Bcs", "LjRl4aEWnSo", "0JZmAXoNUDw", "zGgVgERbVHk", "npR2EkyPXbo", "srt2NuMUmpk", "_QMypwMP0Bs"]', '["Thank you. I really appreciate \ud83d\ude4f your video. I had looked at several Irvine Company apartments a few years ago. But I was not in a position to afford one. Center Point, after seeing your video is now my favorite. I do remember going there and how pretty the community is, resort like, greenery, stunning property. As you said, it is like it''s own City. Second choice which I saw was The Park. I had seem more, but these two are still my top two. I will go back to work this year 2024 or early 2025. Planning to go see these two apartments, probably will pick Center Point, as it has more to offer. \nBoth truly beautiful complexes.", "The yogurt and pretzels something something also the escape gameee i played all of em (my favorite\u2019s prison break and gold rush) with my stupid cousins and my brother and my mom about 2 years ago", "Nice", "Thinking of buying or selling in Orange County? Let''s connect! \ud83d\udcf2 714-402-4212  \ud83d\udce7monica@monicacarr.com", "I''ve lived in Irvine since 1982 and I love it", "This video is fantastic! I hope to see more like this in the future!", "Thanks for putting so much effort into your videos. You''re amazing!", "You explained everything so well, I really appreciate it!", "This video was so helpful, thank you for sharing your knowledge! \ud83d\ude4f", "This city was an awesome place to grow up. Not as good as it used to be.", "Is Irvine CA walkable city?", "I''ve been to Irvine California its soulless and sterile", "Wonderful review! Thank you greatly.", "Burada ya\u015famay\u0131 ger\u00e7ekten \u00e7ok isterdim \ud83d\ude0a\ud83c\udfe1", "Chill, she did her best", "bro why did you show lit the most boring parts of irvine", "peak suburban hell", "No thanks", "\u2705 You might enjoy watching my video on Crystal Cove: https://youtu.be/n6cIfZeH4AI\r\n\u2705 Or Laguna Beach: https://youtu.be/Ek55xJ2md5E", "Habit is better than In-N-Out", "Irvine company is the worst", "Thank you Sir \u2764\u2764\u2764\u2764", "This is not. BIG mall as stated, it\u2019s okay. Beautiful spot but not much shopping options as an indoor mall.", "Very Wonderful Shopping Center Video!!! I Love the Fountains!!!! F+L, Corey", "Be careful of that Cheesecake location. Got food poisoning there.", "I was from the Orange County area. I lived thier for 11 years and the Irvine Spectrum was one of my favorite spots to go shopping.", "Wow, last time I was here Macy\u2019s was still there! Still surprised they closed that location but glad to see they repurposed the space nicely.", "I remember when spectrum juuuust started...could never believe it would become this big.", "8:20 assigned and 8:38 very difficult for someone to drive in and use grill. street parking are for guests and you have to have a pass on your car bc they monitor CONSTANTLY, meaning no time trying to drive in and use the grill", "Don\u2019t do it find another place another state", "Welcome to California. Welcome to Orange County the Irvine development company building huge compounds to shuffling people. That is their goal. Heavy taxes have a government and you will get nothing.", "Just one big heaping mound of regret why would you don\u2019t do it?", "I hope you love taxes and heavy government. Enjoy", "Why would you buy a property in California?\ud83d\ude02 What an absolute joke", "I love Woodbridge =) That''s why I sold my home in Stonegate and moved back to Woodbridge.", "Irvine is the type of place where a security guard will pull you over for your car being dirty, and it\u2019s all Asians and middle eastern people and the entire city is owned by a company \ud83d\ude02\ud83d\udc4e", "used to be great, now, not so much. also horrible people and bad drivers. moved away and thank God I did.", "Parts of Northwood have no HOA and no Mello Roos!", "I remember articles about toxic materials in the soil, found during construction in Irvine. Which area is that?\nThanks", "Thank''s for another great contribution, but Irvine is to much cookie cutter. I am not a cookie cutter loving person."]', 0.83, '{"sources": {"zori_csv": true, "overpass_grocery": true, "overpass_night_activity": true, "overpass_noise": true, "irvine_crime": false, "youtube_video": true}}');
INSERT INTO community_metrics (community_id, updated_at, median_rent, rent_2b2b, rent_1b1b, avg_sqft, grocery_density_per_km2, crime_rate_per_100k, rent_trend_12m_pct, night_activity_index, noise_avg_db, noise_p90_db, youtube_video_ids, youtube_comments, overall_confidence, details_json) VALUES ('woodbridge', '2026-02-24 05:30:17.941531', 3400.2223362668137, NULL, NULL, NULL, 0.442, NULL, 2.48, 0.0, 62.0, 69.0, '["i9Qj70vWaAY", "2nWey4MCXW4", "-8PTPy8HsmU", "U3HD51SY76Q", "84vX4334odw", "5tu2lcRB-RU"]', '["cool ill b going here this weekend im excited thanks for the heads up info the spot looks relaxing and a great view", "\ud83e\udd14Thinking of moving to or selling your home in Irvine California?\ud83c\udf34\r\n\ud83d\udcf1Call or text:  949-285-1207\r\n\ud83d\udce7Email:  info@livinginirvinecalifornia.com\r\n\ud83d\udcc5Zoom:  http://bit.ly/3ZeNnEa\r\n Full Channel: \ud83d\udc49\ud83d\udc49\ud83d\udc49: https://bit.ly/3NXecX3\r\n=======", "I live in Woodbridge and I love it \ud83d\ude0a", "Please check your mail, I''ve sent a message about your YouTube Channel", "I live in Woodbridge and I LOVE it \ud83d\ude0a", "I grew up in the houses along the lake in the beginning of the video.  I forgot if it was either north or south lake. It was in the 80s. Went to stonecreek elementary.  It was such a fun time.  I miss it. \ud83d\ude22", "Thanks for the video.  I grew up in Woodbridge. Went to Eastshore elementary and lake side middle school. Haven''t seen cali in a minute thanks again.", "Do a video on Great Park Neighborhoods", "Nice content! The theme song from the OC plays in my head every time I see y''all. Maybe it''s a sign?", "We bought our 4 bedroom home down here in Laguna Hills back in 2009 for 500K and the price has doubled now. Best place to live with no HOA or Mello Roos tax.", "Great videos! Love your content! I just think it gets too chilly in the winter near the beach especially how it is more windy with the cold sea breeze. During summer it''s perfect to me though. I prefer inland during winter due to higher warmer daytime Temps compared to the daytime Temps near the beach areas during winter or cold months.", "\ud83e\udd14Thinking of moving to or selling your home in Irvine California?\ud83c\udf34\r\n\ud83d\udcf1Call or text:  949-285-1207\r\n\ud83d\udce7Email:  info@livinginirvinecalifornia.com\r\n\ud83d\udcc5Zoom:  http://bit.ly/3ZeNnEa\r\n Full Channel: \ud83d\udc49\ud83d\udc49\ud83d\udc49: https://bit.ly/3NXecX3\r\n=======", "In Woodbridge, we are representing owners in the leasing of a beautiful 4 bedroom, single family home at 70 Summerstone. Very nice upgrades, spacious backyard:  love living in Woodbridge by leasing 70 Summerstone!\n\nhttps://www.bruceclarkgroup.com/listing-detail/1170134714/70-Summerstone-Irvine-CA\n\n#woodbridgeirvine #bruceclark #realbroker #homeforlease", "We love Irvine and Woodbridge has so many great things to offer residents. As of 10/1/2025, we have two properties available in Woodbridge:  43 Glenhurst, which is being offered for sale or for lease. A very nicely-upgraded 3 bedroom condo.\n\nhttps://www.bruceclarkgroup.com/listing-detail/1166293290/43-Glenhurst-Irvine-CA\n\n#IrvineCondo #condoforlease #irvinerealestate #woodbridge"]', 0.83, '{"sources": {"zori_csv": true, "overpass_grocery": true, "overpass_night_activity": true, "overpass_noise": true, "irvine_crime": false, "youtube_video": true}}');
INSERT INTO community_metrics (community_id, updated_at, median_rent, rent_2b2b, rent_1b1b, avg_sqft, grocery_density_per_km2, crime_rate_per_100k, rent_trend_12m_pct, night_activity_index, noise_avg_db, noise_p90_db, youtube_video_ids, youtube_comments, overall_confidence, details_json) VALUES ('university-town-center', '2026-02-24 05:30:41.067528', 3400.2223362668137, NULL, NULL, NULL, 1.326, NULL, 2.48, 16.67, NULL, NULL, '["wDzbxwCvwnA", "VRP0qwI2aiI", "-8PTPy8HsmU", "qDwa2gzdU4k", "DMn1-2AC5Pw", "He02nadfIvE", "RkeFAo46j_U", "as7Ucp2tDds", "dX09aCeDP6s", "OemD78j7oHQ", "TH309BGkaPA", "hE3oP-bG3as", "Nz2VCPxuVes", "a56Yz3v3UMU", "aDgPE4ItucQ", "iog9DvjQOJw", "Hd2wxg9z93c", "Y90Sy9L3oio", "HJ_QRDb4mpM", "zOOkLXIuRyw", "2doZYcf-Coo", "3lep-Ui5FxE", "qqDELZDhRw0", "L_qx_J2l7IE", "k3T6DzCCzL4", "cKjiXFOEBxQ", "nmDS992Eh84", "cwTxYYyz0qE", "RrE6nvwx-jU", "PzcCU0ptRQs", "wyJp732XSXo", "IcaoRyFU8a0", "kDl6zW6sBvw", "Y0Su6I_Nu3M", "5tTtzRH1QAQ", "r453eA6tJkE", "fOiGBeDSFUM", "hSBxdT42QHw", "kOOtA8Snjx0", "NitCpMg3RTE", "C46o6WnNqD8", "DfOZlWxs1aQ", "nYtWu-DH-8Y", "-H1L4lrwlso", "LJv2BkHnpU0", "ReuCsIZgXkI", "LVA9_Kd-gvg"]', '["Can you do the plaza in cypress village please?", "WOAH!", "So these are the cool dudes Elliot Rodgers envied? Man, your average INCEL looksmaxer from tiktok looks better than this people, they could be Jesse Pinkman friends \ud83d\ude02", "I graduated in 1987 and I paid $200 a month and that included 3 meals a day in all 3 dining commons and I had no roommates (single) in San Rafael hall.\n\nAfter I graduated with a CS degree, I drove up to Silicon Valley and got a job as a programmer.  In 1996, I bought a house for $200K which is now worth $3.3 million.  I retired this year financially very comfortable with a loving wife, loving family and was able to build generational wealth for my family and kids.  I had an awesome life (so far) and it was all due to CS degree from UCSB.  Enjoy yourself but remember, your future rides on what you decide to make of UCSB experience.", "Thank you, this gives me an idea of how next year will be.", "It always help having rich  mommies and daddies", "thats fucking crazy", "Death to the people you serve hi hi", "Whos gonna back up the jersey you sport white trash Olympians, your pieces of shitv Mafalaw money  Billie pie $ my my nuka why gook die pussy bike SunSet seal died.", "God knows I hated that place", "\ud83c\udfd6\ufe0f California Complete Guide \ud83d\udc49 - https://www.youtube.com/watch?v=JTaAknEwSy0", "A very poor quality video, could not read the captions", "Family Fun Center/Bullwinkle\u2019s?", "1:36\nOML THAT WAS ME IN KINDERGARTEN AND MY TWIN BRO\n(Left is meh right is meh twin bro)", "I\u2019m the boy all the way to the right when I was in kindergarten.", "I think the only fun thin in Irvine is the grate park and the spectrum", "18-blizzard", "love it", "Can we come over to see the apartment tomorrow morning or", "You aren''t even giving info through this video", "Nice where are you located?", "Garage is wide", "why advertise and not give info. just for clicks?", "were?", "How much", "How much and location?", "How much does it cost per month", "My sound is not working", "Reach out with any questions.\nCall or Text: 323-350-5770\nEmail: matt@thebritishbloke.com", "Than you. can you do a map tour for laguna area as well", "Nice video of all comparison units. Beautiful parks. Thanks for your hard work! Would love to see a review of living in Fullerton/Brea. May have contract job at biotech there. Thanks \ud83d\udc4d \ud83d\ude0e Maggie", "Which neighborhood do you prefer?", "The way he says \u201cneivorhood\u201d cracks me up lol", "I like those lakes!", "are there homes 3br 2+ba around 700 to 800k?", "Can you do similar videos but for Lake Forest, Mission Viejo, and Laguna Nigel? basically south of Orange County.", "I liked Westpark", "Hlo sir...really nice information...i am searching for a room for rent in any of these location as an international student . Can you please tell me where can i find cheapest one", "Westpark was not made in the late 80''s, they were made in 1994 (fully built all houses by 1996). Sorry to bug you about that, but who told you they were around in the 80''s?\n\nIn 1992, the area when Westpark even thought about building houses, it was all fields, and they had a thing called \"The Harvest Festival\" there. It was a yearly event (moved each year) and it''s final year (in Irvine) was 1999, off Culver and Trabuco near the 5 Freeway.", "These five are not cities, right?", "Hola mi nuera quiere comprar una casa en alguna sona de esas donde el precio sea mas accesible,cual recomendarias", "Wrong name, it\u2019s called University Town Center.", "All i see is asians", "University of Chinese Immigrants", "By the 2nd week, you''re already cramming for midterms or working on your transfer to Cal State", "It was pretty diverse when I went back in the day, but it may have changed.  You say for \"a semester\".  FYI: UCI is on the quarter system, which is a LOT harder.  By the 2nd week, you''re already cramming for midterms or working on your transfer to Cal State (which does indeed have a MUCH more humane & practical orientation).", "wait, so when there is 40%+ of white students (which is most universities) it''s considered diverse, but when its 40%+ of asian students it''s not??", "The anteater is still there", "You could use the Anteater bus!", "The Pub is still there", "It''s easy to get lost in the crowd at a UC school. When I was an undergrad I found it difficult to make friends but looking back it was largely due to being a commuter student, transferring in and not being part of a club/organization. Like most things in life it''s what you make of it, nobody is going to spoon feed you a good career, academics, and especially not a social life. I can''t speak on UCI but the UC I attended I had a very similar experience.", "\"Not diverse.\"  Just say there are too many Asians.  Be a man!", "If you''re thinking about starting your own Bnb, or need tips on furnishing and managing your properties, I''ve got some resources that might help! Check out my store \ud83d\udc49\ud83c\udffd https://tinyurl.com/4u6uhbfv", "We stayed at an air b&b in Paris & my wife fell down the stairs & was injured  in one of their apartments as the bathroom was outside the apartment across a dark hall . We called to see what they would do & the promised they would change our apartment at no cost for both apartments but when we got back home they had charged us for the second apartment & when we contacted them they gave us the run around obviously hoping we would just give up . We will never be using them again & we travel every year", "You can easily pull the refrigerator out and retrieve the sign. It\u2019s also a good practice to keep dust build up away from the refrigerator to ensure the longevity of the appliance. I do it in my own home. Easy.", "This is why they ppl don\u2019t want to use them anymore!!! No ppl should not break or steal things but why are owners posting about guests!?!? Bad move. Wham ya make your bed you gotta sleep in it.", "Move the fridge and sweep under it while you\u2019re at it.", "Wow, that seems like good money but I am not sure I could be an air bnb host. But I don\u2019t own a home, I live in an apartment. Just saying if I owned a house I would be scared to let strangers stay there and do bad things to it.", "You had many places to put the WIFI sign.  Just put the new sign in a spot where if it falls down, it''s easy to put it back up.  Your place is very nice.  The kitchen especially!", "Sell the damn place and let someone LIVE THERE!", "my airbnb guests always lose stuff too", "wow i can''t believe they took stuff", "Can we have a video on your gpa and stats", "How did you find your Bible study group ?", "Could you sound any more monotone and boring my g? Lol couldn\u2019t be me", "What''s the sound used on this video pls?", "I  was a freshman there  in 1981. My last class there was in 1992. This is mostly unrecognizable!", "I got accepted today and I\u2019m so skeptical, any help guys? \ud83d\ude2d", "is UCI different  UC Berkeley or not", "Talk to student services for student discounts", "Thank you, it\u2019s a really helpful video", "just accepted to the drama program!", "Just got in \ud83d\ude2d waiting on the other UCs but I\u2019m loving the campus so far", "Just accepted!", "Says \"Cross Culture\", literally everyone is Asian... lol", "======\nFull Channel: \ud83d\udc49\ud83d\udc49\ud83d\udc49: https://bit.ly/3NXecX3\n=======\nContact us: \ud83d\udc47\ud83d\udc47\ud83d\udc47 \n\ud83d\udcf1Call or text:  949-285-1207   \n\ud83d\udce7Email:  info@livinginirvinecalifornia.com\n\ud83d\udcc5Schedule a Zoom Call So That We Can Meet \"In-Person\":  https://calendly.com/living-in-irvine-ca/30min?month=2022-10", "0,5 bath is killing me \ud83d\ude02", "LAWD \ud83d\ude2e\ud83d\ude2e\ud83d\ude2e", "This lovely! I need this but in Arizona and half the price", "woah", "That\u2019s the price of my 3 room apartment in Singapore. Damn \ud83e\udd7a", "Really \ud83e\udd14", "Bro if u were in canada u would be broke \ud83d\ude05", "No way! this is even cheaper than in Thailand", "That\u2019s a lot of money my house is like 75k and it\u2019s like 5 times smaller but that\u2019s okay for me", "Bro they mean a month", "Thanks for stopping by!! \ud83d\ude01\ud83d\ude04\ud83d\ude04\ud83d\ude01", "En Colombia \ud83c\udde6\ud83c\uddf2 8.000 d\u00f3lares son 40 millones de pesos. \ud83d\ude2e", "Thats a crazy price", "8k for a shoebox is sinful", "What does she do?", "All she can afford left is just one cup of coffee to go.\ud83e\udd23\ud83e\udd23\ud83e\udd23\ud83e\udd23\ud83e\udd2a\ud83c\uddfa\ud83c\uddf8", "My rent $650 by the beach Rochester", "lol clearly he\u2019s never been to Maryland catching strays  \ud83d\ude02\ud83d\ude02\ud83d\ude02", "Overpaying.", "For that money, I\u2019m literally a king of the kings in Thailand", "I can not u