INSERT INTO review_post (post_id, community_id, platform, external_id, url, posted_at, title, body_text) VALUES ('2fe8420a-d5f3-490e-a021-c25e31fd74c4', 'costa-mesa-border', 'youtube', 'yt-b32403d967cce84dcdc37a5a8611c008', NULL, '2026-02-24 05:32:29.424173', NULL, 'Which month did you travel to Costa Rica?');
INSERT INTO review_post (post_id, community_id, platform, external_id, url, posted_at, title, body_text) VALUES ('92f96d51-d939-4e11-a33c-17d9d1c38662', 'costa-mesa-border', 'youtube', 'yt-8748b67f2229675ffbc360f8dab515dd', NULL, '2026-02-24 05:32:29.424197', NULL, 'Not to hate, but I‚Äôm from costa rica and I get very sad when someone says not to spend time on San Jose and instead going to place that many cr people can‚Äôt afford or just get discriminated there.');
INSERT INTO review_post (post_id, community_id, platform, external_id, url, posted_at, title, body_text) VALUES ('a3b13e66-6fa7-42b1-8926-64b63c276915', 'costa-mesa-border', 'youtube', 'yt-4872721018f0ebf337d8ec9724cfca54', NULL, '2026-02-24 05:32:29.424221', NULL, 'Guys, i went to costa rica last year, and i‚Äôm going again tomorrow. If u like tea, just be warned, they do NOT have tea. Starbucks mayyyy have some, but most places DON‚ÄôT. This year, my family is taking tea bags for our week in cr. Just be warned if u like tea! ‚ù§');
INSERT INTO review_post (post_id, community_id, platform, external_id, url, posted_at, title, body_text) VALUES ('869de79a-9a92-46de-ae7d-a4f5352c1497', 'costa-mesa-border', 'youtube', 'yt-d53a743a985aa82948000804f6f61106', NULL, '2026-02-24 05:32:29.424245', NULL, '43k a month! Lmfao! We are all screwed! You mean 4,300 a month. Still crazy!');
INSERT INTO review_post (post_id, community_id, platform, external_id, url, posted_at, title, body_text) VALUES ('b706b0f9-268b-4426-9169-f8def63f7c8e', 'costa-mesa-border', 'youtube', 'yt-f6884430fd15feeccbe1095e882b6a36', NULL, '2026-02-24 05:32:29.424269', NULL, 'I lived in one but you neglected to say that normally you share the room with a roommate');
INSERT INTO review_post (post_id, community_id, platform, external_id, url, posted_at, title, body_text) VALUES ('a5cf29f2-6e4a-487b-82c5-d22ad22a04fc', 'costa-mesa-border', 'youtube', 'yt-261a12ca281ba4e78c99010c19dbc575', NULL, '2026-02-24 05:32:29.424292', NULL, '$43,000 a month. I can live at home with 24/7 nurses for less. What a travesty.');
INSERT INTO review_post (post_id, community_id, platform, external_id, url, posted_at, title, body_text) VALUES ('7c39e421-79c5-416b-a3de-1b2a26294a3b', 'costa-mesa-border', 'youtube', 'yt-cfe96a4e63291f7badf4a87eaf4d2983', NULL, '2026-02-24 05:32:29.424317', NULL, 'Where did you learn your math skills $43.000/month doesn''t equal over $50.000/year!!');
INSERT INTO review_post (post_id, community_id, platform, external_id, url, posted_at, title, body_text) VALUES ('63a302bc-b3df-4c07-840d-3a4accb9c532', 'costa-mesa-border', 'youtube', 'yt-533626869ba0cba0adc52eebd24b6242', NULL, '2026-02-24 05:32:29.424340', NULL, 'At $43,000 a month Thats well over $51,000 a yearüòÇ');
INSERT INTO review_post (post_id, community_id, platform, external_id, url, posted_at, title, body_text) VALUES ('83fe60ad-fa3a-4c36-a8e4-8bae2b213532', 'costa-mesa-border', 'youtube', 'yt-e7b5a1b11cf5666ee2e93b4d6a022319', NULL, '2026-02-24 05:32:29.424364', NULL, 'That sounds like she meant 4,300.00 a month, not 43,000. And yes, on the low end you can expect to pay 50-60k a year. Many places are now 9-10k a month. So, 100-120k a year. And that‚Äôs before the extras.');
INSERT INTO review_post (post_id, community_id, platform, external_id, url, posted_at, title, body_text) VALUES ('a1a61a88-9c74-40fa-990a-da21dde1e8a4', 'costa-mesa-border', 'youtube', 'yt-3889e821b308ba36d8fc0e8abcae1b4a', NULL, '2026-02-24 05:32:29.424388', NULL, 'Well I visited two upon being told it was strongly recommended my grandma go to one rather than come home. Both had dementia patients in wheel chairs just stuck in the halls and corners. It was sad');
INSERT INTO review_post (post_id, community_id, platform, external_id, url, posted_at, title, body_text) VALUES ('a5a82c37-327e-45f6-a72a-3660440feed2', 'costa-mesa-border', 'youtube', 'yt-0c49f66b71d2f13dbbb63872c65ee57f', NULL, '2026-02-24 05:32:29.424411', NULL, '$43k a month is WAY MORE than $51k/year. Check your math.');
INSERT INTO review_post (post_id, community_id, platform, external_id, url, posted_at, title, body_text) VALUES ('816990ca-cdbd-4d0f-b7c4-3032654cd06e', 'costa-mesa-border', 'youtube', 'yt-ac3bb409621646530cb2d7510827b83f', NULL, '2026-02-24 05:32:29.424435', NULL, 'My husband was looking forward to moving to assisted living without me. By all means.');
